import Vue from 'vue'
import VueRouter from 'vue-router';
Vue.use(VueRouter);

import test from "../components/test.vue"
const routes = [
    // {
    //     path:'/',
    //     redirect: '/test'
    // },
    {
        path:'/test',
        component:test
    }
]

const router = new VueRouter({
    routes
})

export default router
